GONESHのシンボルは、Ganesha(ガネーシャ）です。<br>
Ganeshaは、 ヒンドゥーの神『シヴァ』の妻で女神『パールバティ』が創造した象の頭を持つ神です。<br>インドでは、知恵と、幸運と約束の神として崇められております。<br>ジェニコ社では、GONESHのブランドにこのganeshaをシンボルマークとしてデザインし、良い香り、新しい香りを提案し続けることや 使われる方に幸運が招かれることを願っております。<br>香りに関する弛まない研究による創香の知恵により、新しい時代を切り開く商品を開発し続けることをお約束致します。<br>Ｇonesh/ガーニッシュスティックは、今アメリカを中心に人気のあるインセンスブランドであり、当店でも最も人気でお勧めのインセンスです。<br><br>１９２３年の創業以来お香を通じてリラクゼーションを追及しているブランドで、香りを楽しむ・リラックスできるという点で他のインド・タイ製のお香と比べて優れています。<br>種類も豊富で、それぞれに個性のある香りが楽しめます。<br>その時の気分、雰囲気に合わせて香りを楽しんでみてはいかがでしょうか？<br><br>スティックタイプは見た目が手持ち花火みたいなもので、燃え尽きる時間は約1時間20分です。<br>持続時間がコーンタイプよりも長いので、香りの残る時間も長いです。<br>また、棒状ですので、使用途中で消しながら使うとさらに長持ちします。<style type="text/css">
